import React, { Component } from 'react'

export class Birthdays extends Component {

    constructor(props) {
        super(props)
        this.state = {
            upcomingBirthdayMembers :{},
            recentBirthdayMembers :{}
        }
    };

    componentDidMount() {
        this.fetchBirthdayMembers();
      };

      fetchBirthdayMembers (days, upcoming) {
        axios.get(`http://localhost:8093/familytree/member/birthdays?days=80&upcoming=true`)
          .then(response => {
            console.log(response.data);
            if(upcoming){
                this.setState({upcomingBirthdayMembers:response.data})
            }else{
                this.setState({recentBirthdayMembers:response.data})
            }
            
          }).catch(error =>{
              console.log(error);
          });
      }

    render() {
        return (
            <div>
                <div>
                    <h3>Upcoming Birthdays</h3>
                    <div>...</div>
                </div>
                <div>
                    <h3>Recent Birthdays</h3>
                    <div>...</div>
                </div>
            </div>
        )
    }
}

export default Birthdays
